import { Link } from 'react-router-dom';
import LateralBar from '../../components/LateralBar';
import Topo from '../../components/Topo'
import './style.css'

function Entrada () {
    return (
        <div>
           <Topo />
           <div> <LateralBar /></div>

           <div className="content">
                <h1>Entrada</h1>
                <ul>
                    <li>tarefa 1</li>
                    <li>tarefa 2</li>
                </ul>
                <Link to="/">sair</Link>
            </div>
        </div>
    );
}
export default Entrada;
